import React, { Component } from "react";
import Link from "next/link";

class Detail extends Component{
    render(){
        const{children1, title1 = "AOWSAY"} = this.props;
        return(
            <div className="container">
                <div className="row">                    
                    <div className="col-4 shadow-sm p-4 mb-5 bg-dark rounded">
                    <Link href={'/blog/detail'}><a>                    
                        <img src="/static/images/products/1.png" className="img-fluid" />
                        <hr/>                          
                    </a></Link>
                    {children1}
                    <h4 className="text-center">{title1}</h4>
                    </div>                    
                </div>
            </div>                             
        )
    }
}

export default Detail;
